pragma solidity ^0.4.21;

import "./Ownable.sol";
import "./SafeERC20.sol";
import "./SafeMath.sol";



/**
 * @title TokenAirdrop
 * @dev TokenAirdrop is a token holder contract that will allow a
 * beneficiary to extract the tokens after a given release time
 */
contract TokenAirdrop is Ownable {
    using SafeERC20 for ERC20Basic;
    using SafeMath for uint256;

    // ERC20 basic token contract being held
       ERC20Basic public token;
    // whitelisting contract being held
    //WhiteList public whitelisting;

    uint256 public totalTokenAirdroped;

    event AddAirdrop ( address _beneficiary, uint256 token);

    modifier checkZeroAddress(address _add) {
        require(_add != address(0));
        _;
    }

    modifier checkZeroValue(uint256 value) {
        require(value != 0);
        _;
    }


      constructor(ERC20Basic _token)
        public
        checkZeroAddress(_token)
    {
        token = _token;
    }

    function addAirdrop (address[] _beneficiary, uint256[] _token)
       external
       onlyOwner
       checkZeroAddress(_beneficiary[i])
       checkZeroValue(_token[i])
    {

     for( uint i = 0 ; i < _beneficiary.length ; i++ ) 
     {
           require(uint256(getBalance()) >=   totalTokenAirdroped.add(_token[i]));
           token.safeTransfer(_beneficiary[i], _token[i]);

           totalTokenAirdroped = totalTokenAirdroped.add(_token[i]);
           emit AddAirdrop(_beneficiary[i], _token[i]);
          } 
    }

    function getBalance() public view returns (uint256) {
        return token.balanceOf(address(this));
    }
}

